import { useState } from "react";
import Player from "./Player";
import classes from "./Activity.module.css";

export default function PlayerList({ players, activityPlayers }) {
  const [find, setFind] = useState("");
  return (
    <div>
      <div className={classes.find}>
        <input value={find} onChange={(e) => setFind(e.target.value)}></input>
      </div>
      <div className={classes.playerList}>
        {players
          .filter((player) => !activityPlayers.includes(player.name))
          .sort((a, b) => a.name.localeCompare(b.name))
          .sort((a, b) => b["lvl"] - a["lvl"])
          .map((player) => {
            return <Player key={player.name} player={player} />;
          })}
      </div>
    </div>
  );
}
